import {
	Button,
	Modal,
	ModalHeader,
	ModalBody,
	ModalFooter,
	FormGroup,
	Label,
	Input,
} from "reactstrap";

class Addvote extends Component {
  render() {
    return (
		<div>
			<Modal isOpen={this.props.addVoteModal} toggle={this.props.toggleAddVoteModal} >
				<ModalHeader toggle={this.props.toggleAddVoteModal}>
				</ModalHeader>
				<ModalBody>           
				</ModalBody>
				<ModalFooter>
				</ModalFooter>
			</Modal>
		</div>
    );
  }
}

export default Addvote;
